import React from 'react';
import './css/UI.css'

function List(title,desc){
  var title ="Morning Activity";
  var desc ="Wake up early and take a jogg with my friend. Also, pick up coffee for breakfast.";
  return(
    <div class="list">
    <div className="title">{title}</div>
    <div className="desc">{desc}</div>
    </div>
  );
}
export default List;
